let logs="",loggerName="Logger",logColor="blue",bgColor="white",isIE=!1;function checkBrowser(){let e=window.navigator.userAgent.indexOf("MSIE ");isIE=e>=0}checkBrowser();try{function log(e,o=!1){isIE?console.log(`${e}     ${o?generateCurrentTime():""}`):console.log(`%c ${e}     ${o?generateCurrentTime():""}`,`color: ${logColor}; background-color: ${bgColor}`),logs+=`${e}     ${o?generateCurrentTime():""}\n`}function success(e,o=!1){isIE?console.log(`${e}     ${o?generateCurrentTime():""}`):console.log(`%c ${e}     ${o?generateCurrentTime():""}`,"color: green"),logs+=`${e}     ${o?generateCurrentTime():""}\n`}function warning(e,o=!1){isIE?console.log(`${e}     ${o?generateCurrentTime():""}`):console.log(`%c ${e}     ${o?generateCurrentTime():""}`,"color: orange"),logs+=`${e}     ${o?generateCurrentTime():""}\n`}function error(e,o=!1){isIE?console.log(`${e}     ${o?generateCurrentTime():""}`):console.log(`%c ${e}     ${o?generateCurrentTime():""}`,"color: red"),logs+=`${e}     ${o?generateCurrentTime():""}\n`}function info(e,o=!1){isIE?console.log(`${e}     ${o?generateCurrentTime():""}`):console.log(`%c ${e}     ${o?generateCurrentTime():""}`,"color: blue"),logs+=`${e}     ${o?generateCurrentTime():""}\n`}function setName(e){loggerName=e}function setForground(e){logColor=e}function setBackground(e){bgColor=e}function generateCurrentTime(){let e=new Date,o=e.toDateString(),n=e.getHours();n=n<10?"0"+n:n;let r=e.getMinutes();r=r<10?"0"+r:r;let t=e.getSeconds();t=t<10?"0"+t:t;let l=e.getMilliseconds();return o+" - "+n+":"+r+":"+t+":"+(l=l<10?"0"+l:l)}function downloadLogs(e=!1){let o=`${loggerName} ${e?" - "+generateCurrentTime():""}.logs`,n=new Blob([logs],{type:"text/plain"}),r=document.createElement("a");r.href=URL.createObjectURL(n),r.download=o,r.click()}}catch(error){console.log("Stop messing with the code, just use the methods already")}